import React, { Component } from 'react'

import './css/index.css'

export default class DropDowm extends Component {
  showDRopDowmList = () => {
    console.log('111');
    console.log(this.showDRopDowmList.style);
  }
  render() {
    const data = this.props.data || this.props.data1
    // console.log(this.props.data1);
    return (
      <div className="dropdown">
        <p onClick={this.showDRopDowmList}>请选择年级<span className='dropdown-icon'></span></p>
        <ul ref={e => this.dropDowmList = e}>
          {
            data.map((value, index) => {
              return <li key={index} >{value}</li>
            })
          }

        </ul>
      </div>
    )
  }
}
